import React from "react";

const todo = () => {
  return (
    <div className="todo">
      <li className="todo-item">waddup</li>
      <button className="complete-btn">
        <i className="fas fa-check"></i>
      </button>
      <button className="delete-button">
        <i className="fas fa-check"></i>
      </button>
    </div>
  );
};

export default todo;
